        public Boolean validateResponseISOPathXML(String xmlPath) {
                try {
                        VALIDATOR.validate(new StreamSource(new File(xmlPath)));
                } catch (IOException | SAXException e) {
                        LOG.error("Exception: " + e.getMessage());
                        return false;
                }
                return true;
        }

        public Boolean validateResponseISOStringXML(String xmlString) {
                try {
                        VALIDATOR.validate(new StreamSource(new StringReader(xmlString)));
                } catch (IOException | SAXException e) {
                        LOG.error("Exception: " + e.getMessage());
                        return false;
                }
                return true;
        }

        @Test
        @Parameters
        public void testValidateResponseISOParamWithXmlPathResultFalse(String xmlPath) {
                Assert.assertFalse(validateResponseISOPathXML(xmlPath));
        }

        @Test
        @Parameters
        public void testValidateResponseISOParamWithXmlStringResultTrue(String xmlString) {
                Assert.assertTrue(validateResponseISOStringXML(xmlString));
        }

        @Test
        @Parameters
        public void testValidateResponseISOParamWithXmlStringResultFalse(String xmlString) {
                Assert.assertFalse(validateResponseISOStringXML(xmlString));
        }

